import React from "react";
import ProjectItem from "../project-item/project-item.component";


export default function ProjectList({ projects }) {
    if(!projects){
        projects = [];
    }
  console.log(projects)
  return (
    <div>
        {projects.map(({ projectBudget, totalTasks, completedTasks, projectName, projectStatus, _id}, index ) => {
          console.log(index)
          return (
            <ProjectItem totalTasks={totalTasks} completedTasks={completedTasks} key={index} projectName = {projectName} projectStatus = {projectStatus} id={_id}/>
          );
        })}
    </div>
  );
}
